import React from 'react'
import {Menu,MenuItem,Button} from '@material-ui/core'

const MenuOfItems = (props) => {
    selectModal = (info) => {
        this.setState({modal: !this.state.modal}) // true/false toggle
      }
    return (
        <div>                                            
            <MenuItem onClick={props.onClick}>VER PERFIL</MenuItem>
            <MenuItem onClick={props.onClick}>VER SINTOMAS</MenuItem>
            <MenuItem onClick={props.onClick}>VER REGISTRO DIARIO</MenuItem>
            <MenuItem className="menu-item-eliminar" onClick={props.onClick,this.selectModal}>ELIMINAR</MenuItem>
            <ModalPopOver 
                displayModal={this.state.modal}
                closeModal={this.selectModal}
            />
        </div>
    )
}

export default MenuOfItems
